import React from 'react';






const App = () => {
    const iss = []
    fetch('http://api.open-notify.org/iss-now.json')
    .then (Response => {return Response.json()})
    .then (data => iss.push(data))

    return (
        <div>
            <div>
                <p>`The current location of the ISS is longitude: ${iss[0]}, latitude ${iss[0]}`</p>     
            </div>
            <button>Click here to know!</button>
        </div>
    )
}

export default App;
